	public static double getString_sameSimility(){
		int the_same_num = stringList.size() - 1;
		int real_same_num = 0;
		for(int i = 0; i < stringList.size();i++){
			real_same_num += the_same_num;
			the_same_num--;
		}
		if(real_same_num == 0){
			return 0.0;
		}
		int simility_num = 0;
		for(int i = 0; i < stringList.size();i++){
			int the_simility = 0;
			for(int j = i + 1; j < stringList.size(); j++){
				if(stringList.get(i).trim().equals(stringList.get(j))){
					the_simility++;
				}
			}
			simility_num += the_simility;
		}
		return simility_num*1.0/real_same_num;		
	}
	
    public  static int lengthOfLongestSubstring(String s) {
        int resultLength = 0;
        for(int i = 0; i < s.length(); i++){
            StringBuilder substirng = new StringBuilder(String.valueOf(s.charAt(i)));
            for(int j = i + 1; j < s.length(); j++){
                if(substirng.indexOf(String.valueOf(s.charAt(j))) != -1){
                    break;
                }else{
                    substirng.append(s.charAt(j));
                }
            }
//            System.out.println(substirng.toString());
            if(substirng.length() > resultLength){
                resultLength = substirng.length() ;
            }
        }
        return resultLength;
    }
	
	
	

